// Combine bytes into 32-bit value (big-endian)
const scaled = (decoded[0] << 24) |
        (decoded[1] << 16) |
        (decoded[2] << 8) |
        decoded[3];
const unsignedScaled = scaled >>> 0; // Force unsigned
const altitudeInMeters = unsignedScaled / 100.0;
let output = {
    altitudeInMeters: altitudeInMeters,
    altitudeFeet:Math.round((altitudeInMeters * 3.28084))
}
msg.payload = output;
return msg;

// Convert bit arrays to bytes
let decoded = msg.payload.data.map(bitArray => {
    let byteValue;
    if (bitArray.length === 8) { // 8-bit unsigned integer
        byteValue = Number.parseInt(bitArray.join(''), 2);
    } else if (bitArray.length === 16) { // 16-bit signed integer
        let signBit = bitArray[0];
        const bits = bitArray.slice(1).join('');
        byteValue = (Number.parseInt(bits, 2) ^ 32768) * Math.pow(-1, signBit);
    } else if (bitArray.length === 32) { // 32-bit signed integer
        let signBit = bitArray[0];
        const bits = bitArray.slice(1).join('');
        byteValue = Number.parseInt(bits, 2) * Math.pow(-1, signBit);
    }
    return byteValue;
});

